import React from "react";

const SignUp = () => {
  return (
    <div className="d-flex justify-content-center">
      <div className="row px-0" style={{ height: "100%", backgroundColor: "" }}>
        <div
          className="mx-0 row col-lg-6 col-md-12 col-sm-12"
          style={{ backgroundColor: "red" }}
        >
          SignUp
        </div>
        <div
          className="mx-0 row col-lg-6 col-md-12 col-sm-12"
          style={{ backgroundColor: "blue" }}
        >
          SignUp
        </div>
      </div>
    </div>
  );
};

export default SignUp;
